import React from 'react'
import { Container, Row,Col} from 'reactstrap';

const Header = () => {
  return (
      <Header className="header">
          {/*============== header top =============  */}
          <div className="header__top">
              <Container>
              <Row>
                  <Col lg="6" md="6" sm="6">
                          <div className="header__top__left">
                              <span>Need Help?</span>
                         </div>
                      
                  </Col>
              </Row>
             </Container>
          </div>
          
    </Header>
  )
}
export default Header;
